mapper.select:

	select 

       from CORE.T_LOG_ONLINE_PAYMENT
	WHERE 1=1      

           and ACCOUNT_NO = #{accountNo,jdbcType=VARCHAR}



           and EXT_BUSINESS_TYPE = #{extBusinessType,jdbcType=VARCHAR}



           and ACCEPT_CHANNEL = #{acceptChannel,jdbcType=VARCHAR}



           and ACCEPT_ORG_SERIAL_NO= #{acceptOrgSerialNo,jdbcType=VARCHAR}



           and SUPPLY_ORG_CODE = #{supplyOrgCode,jdbcType=VARCHAR}



        	and  SUPPLY_ORG_CODE in (
        	SELECT ORG_CODE FROM T_INFO_ORG_TERMINAL WHERE
			TERMINAL_NO=#{terminalNo,jdbcType=VARCHAR} and check_flag='2' and archived_flag='1')	

       AND
		TRANS_SERIAL_TYPE!='3' AND REVSAL_FLAG is null
		ORDER BY
		TRANS_TIME DESC


	select 
	   count(0)
       from CORE.T_LOG_ONLINE_PAYMENT
	WHERE 1=1      

           and ACCOUNT_NO = #{accountNo,jdbcType=VARCHAR}



           and EXT_BUSINESS_TYPE = #{extBusinessType,jdbcType=VARCHAR}



           and ACCEPT_CHANNEL = #{acceptChannel,jdbcType=VARCHAR}



           and ACCEPT_ORG_SERIAL_NO= #{acceptOrgSerialNo,jdbcType=VARCHAR}



           and SUPPLY_ORG_CODE = #{supplyOrgCode,jdbcType=VARCHAR}



        	and  SUPPLY_ORG_CODE in (
        	SELECT ORG_CODE FROM T_INFO_ORG_TERMINAL WHERE
			TERMINAL_NO=#{terminalNo,jdbcType=VARCHAR} and check_flag='2' and archived_flag='1')	

       AND
		TRANS_SERIAL_TYPE!='3' and REVSAL_FLAG is null

select  
from      CORE.T_LOG_ONLINE_PAYMENT
where
     ACCEPT_ORG_SERIAL_NO= #{acceptOrgSerialNo,jdbcType=VARCHAR}
and   ACCEPT_ORG_TRANS_DATE=  #{acceptOrgTransDate,jdbcType=VARCHAR}
and   ACCEPT_ORG_TRANS_TIME=  #{acceptOrgTransTime,jdbcType=VARCHAR}

     and ACCOUNT_NO= #{accountNo,jdbcType=VARCHAR}

and ACCEPT_ORG_CODE = #{acceptOrgCode,jdbcType=VARCHAR}
and (TRANS_SERIAL_TYPE='1' or  TRANS_SERIAL_TYPE='2')

    select * from CORE.T_LOG_ONLINE_PAYMENT where
		L_TRANS_SERIAL_NO=#{value,jdbcType=VARCHAR}
